package com.java.gurpreet.cache;

public class EntrySet<Key, Value> {
    Key key;
    Value val;
    public EntrySet(Key key, Value val){
        this.key = key;
        this.val = val;
    }
    public Key getKey(){
        return this.getKey();
    }
    public Value getVal(){
        return this.val;
    }
}

